import { StyleSheet} from 'react-native';

const styles = StyleSheet.create({
    addTask: {
        bottom: 30,
        paddingHorizontal: 20,
        width: '100%',
        flexDirection: 'row',
        justifyContent: 'space-between',
        alignItems: 'center'
    },

    input: {
        height: 44,
        width: '80%',
        backgroundColor: "#fff",
        borderRadius: 5,
    }
})

export default styles;
